Aikštės šeimininkams po du įvarčius pelnė  Danielius Nomanovas  ir Aurimas Gaidauskas, po vieną – Artūras Katulis ,  Laisvydas Kudrevičius , Mantas Marcinkevičius ir Karolis Krasilnikovas. Elektrėnų klube debiutavęs garsus Lietuvos ledo ritulininkas  Darius Kasparaitis  atliko rezultatyvų perdavimą ir antrajame kėlinyje gavo dvi baudos minutes. Pirmąją nesėkmę patyrusioje Kauno ekipoje pasižymėjo  Petras Nausėda . Elektrėniškiai į vartus metė 44 kartus, o kauniečiai – 20. Pasižiūrėti rungtynių atvyko ir dar vienas elektrėniškis  Dainius Zubrus , kurį ledo rūmuose susirinkę sirgaliai pasitiko griausmingomis ovacijomis. Pirmą kartą karjeroje savo gimto miesto marškinėlius užsivilkęs legendinis Lietuvos ledo ritulininkas Darius Kasparaitis žaidė praktiškai iškart po ilgos kelionės: ledo ritulininkas tik pirmadienį atskrido iš Jungtinių Amerikos Valstijų. Ant ledo lietuvis pasirodė nesitreniravęs ir net nespėjęs deramai pailsėti. Visgi D. Kasparaitis patikino, kad iki kitų rungtynių, kuriose jis jau rungtyniaus su Lietuvos rinktinės marškinėliais „CROWNS Baltijos iššūkio taurėje“, spės atsigauti ir parodyti geresnį žaidimą. „Pirmą kartą žaidžiu už „Energiją“, todėl šios rungtynės buvo išskirtinės. Taip pat girdėjau, kad „Kaunas Hockey“ nei vienų rungtynių nebuvo pralaimėjęs, todėl buvo intriga. Žaisti savo mylimame mieste, kuriame gimiau ir užaugau bei laimėti yra labai malonu“, - po rungtynių sakė D. Kasparaitis. Jis taip pat liko sužavėtas ir „Energijos“ sukurta švente, kurios pasižiūrėti atėjo apie du tūkstančiai sirgalių: „Labai gera šventė, malonu grįžti namo ir pamatyti, kad „Energijos“ susirinko palaikyti tiek daug žmonių“. Kartu su D.Kasparaičiu į Lietuvą atvyko ir dar vienas  NHL  lygoje rungtyniavęs lietuvis Dainius Zubrus, kuris iš tribūnų stebėjo savo gimtojo miesto komandos pergalę. Pasak D. Kasparaičio, didelė tikimybė, kad D. Zubrus spės pasiruošti ir atvyks kartu su juo rungtyniauti už Lietuvos rinktinę pasaulio čempionate Kaune. „Aš jau pasiruošęs, o jis dar ne (šypsosi). Mes abu kartu čiuožiame Amerikoje ir manau, kad jis iki balandžio mėnesio pasaulio čempionato Kaune bus pasiruošęs“, - sakė D. Kasparaitis. (function(d, s, i, r) {
